import React from "react";
// import logo from './logo.svg';
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import "./App.css";
import profile from "./Assets/img.JPG";

function App() {
  return (
    <div className="App">
      <Navbar />
      <header>
        <div className="container bg-white border border-light pb-4">
          <h2 className="text-info py-2">About Me</h2>

          <div className="container border border-dark mb-4"></div>

          <div className="container">
            <img src={profile} className="float-left pr-3" alt="profile"></img>
            <small className="text-muted">
              {" "}
              Welcome to my page. My name is Kenny Nguyen. I am currently
              attending The Coding Boot Camp at University of Irvine, Continuing
              Education. Upon completing my program, I will have experience in
              web development. I have worked with html, css, and Java Script. I
              also have used libraries such as bootstrap. My past experience
              includes coding language Java and C++. Please check back soon to
              see updates on my progress. Have a good day!
            </small>
          </div>
        </div>
      </header>
      <Footer />
    </div>
  );
}

export default App;
